const Footer = () => {
  return (
    <div className="footer">
      <h3>Attendence Manegement</h3>
      <div className="row">
        <div className="col-4">
          <h5>Contact No: 8539903147</h5>
        </div>
        <div className="col-4">
          <h5>Email : swati070103@gmail.com</h5>
        </div>
        <div className="col-4">Address : India ,Bihar</div>
      </div>
    </div>
  );
};
export default Footer;
